import React from 'react';
import "../hojas-de-estilo/Menu.css";

function Menu(){
    return(
    <div className='cont_menu'>
      <div className='logo'><span>Sneaker</span></div>
      <nav className='menu'>
        <div><span>Collections</span></div>
        <div><span>Men</span></div>
        <div><span>Women</span></div>
        <div><span>About</span></div>
        <div><span>Contact</span></div>
      </nav>
    </div>
    );
}

export default Menu;
